function Sidebar(props){
    return(
         <>
           <SidebarMenu>
            <SidebarMenu.Header>
              <SidebarMenu.Brand style={{margin:"10px"}}>
                 <img src={Img}/>
              </SidebarMenu.Brand>
              <SidebarMenu.Toggle/>
            </SidebarMenu.Header>
                 <SidebarMenu.Text style={{marginLeft:"5px", padding:"5px", fontWeight:"bolder"}}>News Bulation</SidebarMenu.Text>
           </SidebarMenu>
         </>
    );
}

